import React from "react";

const Unmatch = (props) =>{
    // let x= props.x;
    // let y= props.y;
    // let z= props.z;
    let {x,y,z}=props;  
    return(
        <>
        <div className="slot_inner">
        <h1>{x} {y} {z}</h1>
        <h1 style={{color:"red"}}>this is not matching</h1>
        </div>
        </>
    );
}
export default Unmatch;
